// ParseCoin attempts to convert a string to a Coin
func ParseCoin(name string) (Coin, error) {
	if x, ok := _CoinValue[name]; ok {
		return Coin(x), nil
	}
	return Coin(0), fmt.Errorf("%s is not a valid Coin", name)
}

func (x *Coin) MarshalText() ([]byte, error) {
	return []byte(x.String()), nil
}

func (x *Coin) UnmarshalText(text []byte) error {
	name := string(text)
	tmp, err := ParseCoin(name)
	if err != nil {
		return err
	}
	*x = tmp
	return nil
}
